Templates.template:
fireWeekNumberSelect(
	{
		weekNumber: ${weekNumber}, // int
		weekDays: ${weekDays} // sap.ui.unified.DateRange
	}
)

fireIntervalSelect(
	{
		startDate: ${startDate}, // object
		endDate: ${endDate}, // object
		subInterval: ${bSubInterval} // boolean
	}
)

fireLeaveRow(
	{
		type: "${type}" // string
	}
)

fireSelect(
	{
		appointment: ${appointment}, // sap.ui.unified.CalendarAppointment
		appointments: [${appointments}], // sap.ui.unified.CalendarAppointment[]
		multiSelect: ${bMultiSelect}, // boolean
		domRefId: "${domRefId}" // string
	}
)

fireChange(
	{
		newValue: "${newValue}", // string
		files: [${files}] // object[]
	}
)

fireFileEmpty(
	{
		fileName: "${fileName}" // string
	}
)

fireFilenameLengthExceed(
	{
		fileName: "${fileName}" // string
	}
)

fireFileSizeExceed(
	{
		fileName: "${fileName}", // string
		fileSize: "${fileSize}" // string
	}
)

fireTypeMissmatch(
	{
		fileName: "${fileName}", // string
		fileType: "${fileType}", // string
		mimeType: "${mimeType}" // string
	}
)

fireUploadAborted(
	{
		fileName: "${fileName}", // string
		requestHeaders: [${requestHeaders}] // object[]
	}
)

fireUploadProgress(
	{
		lengthComputable: ${bLengthComputable}, // boolean
		loaded: ${loaded}, // float
		total: ${total}, // float
		fileName: "${fileName}", // string
		requestHeaders: [${requestHeaders}] // object[]
	}
)

fireUploadStart(
	{
		fileName: "${fileName}", // string
		requestHeaders: [${requestHeaders}] // object[]
	}
)

fireItemSelect(
	{
		item: ${item} // sap.ui.unified.MenuItemBase
	}
)

fireSelect(
	{
		item: ${item} // sap.ui.unified.MenuItemBase
	}
)

fireFocus(
	{
		date: ${date}, // object
		otherMonth: ${bOtherMonth}, // boolean
		restoreOldDate: ${bRestoreOldDate} // boolean
	}
)

fireWeekNumberSelect(
	{
		weekNumber: ${weekNumber}, // int
		weekDays: ${weekDays} // sap.ui.unified.DateRange
	}
)

fireFocus(
	{
		date: ${date}, // object
		notVisible: ${bNotVisible} // boolean
	}
)

fireFocus(
	{
		date: ${date}, // object
		notVisible: ${bNotVisible} // boolean
	}
)
